import styled from "styled-components";

const StyleDiv = styled.div`
   border: 2px solid black;
   border-radius: 5px;
`

export default function Card(props) {
   return (
      <div>
         <button onClick={()=>{props.onClose()}}>X</button>
         <p>{props.name}</p>
         <p>{props.status}</p>
         <p>{props.species}</p>
         <p>{props.gender}</p>
         <p>{props.origin.name}</p>
         <img src={props.image} alt="" />
      </div>
   );
}
